import React, {useState} from "react";
import { ScrollView ,View, Text, StyleSheet, Image, TouchableOpacity, TextInput} from 'react-native';

//const image = { uri: "https://wallpaperaccess.com/full/1182654.png" };

const image = { uri: "https://wallpaperaccess.com/full/1182654.png" };


const Home = ({navigation}) => {

  const [Homename, setHomename] = useState('any');

  return (

    <View style={styles.container}>

      <ScrollView 

        showsVerticalScrollIndicator ={true} 
        showsHorizontalScrollIndicator ={false}
      >
      <View style = {styles.circle}> 
        </View>
        <Image source={require('./images/logo.png')} style={styles.logo} />
            <View style = {styles.inputContainer}> 
                <TextInput
                style = {styles.username}
                onChangeText = {text => setHomename(text)}
                placeholder=  'Username'
                placeholderTextColor = 'gray'/> 
            </View>

            <View style = {styles.input}> 
                <TextInput
                style = {styles.password}
                placeholder = 'Password'
                secureTextEntry = {true}
                placeholderTextColor = 'gray'/> 
            </View>

            <View>

            <TouchableOpacity 
                onPress={() => navigation.navigate('Search Page', { paramKey: Homename,})} 
                style={styles.loginBtn}>
                <Text style={styles.logintext}>Login</Text>
            </TouchableOpacity>

            <View style ={styles.signUpView}>
              <Text style={styles.signUpText}>
                Don't have an account?
              </Text>

              <TouchableOpacity 
                onPress={() => navigation.navigate('Register Page')} 
                >
                <Text style = {styles.signUp}> Sign up here</Text>
              </TouchableOpacity>


            </View>


            </View>

            </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({

  circle: {
    width: 200,
    height: 200,
    borderRadius: 200 / 2,
    backgroundColor: "#0B0C10",
    borderColor: '#66FCF1',
    borderWidth: 1,
    alignSelf: 'center',
    marginTop: 150,
    //marginBottom: 50
  },

    container: {
      flex: 1,
      alignContent: 'center',
      flexDirection: "column",
      backgroundColor: '#0B0C10',
    },

    logo: {
      alignSelf: 'center',
      //marginRight: 225,
      height: 100,
      width: 190,
      marginTop: -150,
      resizeMode: "contain",
      //flexDirection: 'row'
      marginBottom: 50

    },

    text:{
        alignSelf: "center",
        fontFamily: "Verdana-Bold",
        fontSize: 30,
        color: "#66FCF1"
    },

    signUpText:{

      fontFamily: "Verdana",
      fontSize: 15,
      color: 'gray',
    },

    signUpView: {

      flexDirection: 'row', 
      marginTop: 150, 
      alignSelf :'center',
      paddingBottom: '10%'
    },

    signUp: {

      fontFamily: "Verdana",
      fontSize: 15,
      color: '#66FCF1',
    },

    searchtext:{
      justifyContent: 'center',
      textAlign: 'center',
      fontFamily: "Verdana-Bold",
      fontSize: 20,
      color: '#fff5ee'
      //fontWeight: 'bold'
    },

    search:{
      alignSelf:'center',
